angular.module("GeneradorInformes").controller("CargandoController",["$rootScope","$scope","$location","InformeService",function(o,r,n,e){"use strict";r.iniciarCargaInforme=function(){e.generar(o.informacionUsuario).then(function(r){o.resultadoInforme=r.data}).catch(function(r){o.resultadoInforme={error:!0,resultado:r},o.resultadoInforme.resultado.nombre=o.informacionUsuario.nombre}).finally(function(o){n.path("/informe")})}}]);